import { Link } from '@react-navigation/native';
import React from 'react';
import { View, Text } from 'react-native';

const HomeScreen = () => {
  return (
    <View>
      <Text>This is my home screen!</Text>
      <Link href="Register">
      </Link>
    </View>
  );
};

export default HomeScreen;
